import React, { Component } from "react";
import "./NavBar.css";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <nav className="navbar">
        <div>
          <ul>
            {this.props.options.map(option => {
              return (
                <li className="navbar-option">
                  <a>
                    {option.title}
                    <div className="navbar-option-dot"></div>
                  </a>
                </li>
              );
            })}
          </ul>
        </div>
        <div>
          <img
            height="45"
            width="45"
            src="http://endlessicons.com/wp-content/uploads/2012/12/search-icon.png"
          ></img>
        </div>
      </nav>
    );
  }
}

export default Navbar;
